import { StyleSheet } from "react-native";

export default StyleSheet.create({
    pag: {
        backgroundColor: "white",
        width: "100%",
        height: "100%"
    },
    card: {
        borderWidth: 1,
        borderColor: "#ccc",
        margin: 5,
        backgroundColor: "#ffe",
        display: "flex",
        flexDirection: "column",
    }
})
